import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const LoginPagePharma = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Authentication logic here, use backend API to verify credentials
    // Redirect to the pharma dashboard
    navigate('/dashboard/pharma');
  };

  return (
    <div className="login-container">
      <h2>Pharma/Laboratory Login</h2>
      <form onSubmit={handleSubmit}>
        <label>Email:</label>
        <input
          type="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        
        <label>Password:</label>
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />

        <button type="submit">Login</button>
      </form>

      {/* Pharma-specific functionalities */}
      <div className="pharma-actions">
        <p>Pharma/Laboratory functionalities:</p>
        <ul>
          <li>Identify New Molecules for Clinical Trials</li>
          <li>Optimize Cell Responses (e.g., IC50, AUC)</li>
          <li>Profile Management</li>
        </ul>
      </div>
    </div>
  );
};

export default LoginPagePharma;
